demo.repl.help:
Perintah tersedia:
  @show              ─ paparkan ringkasan kad adaptif terakhir
  @json              ─ keluarkan nilai JSON mentah yang diterima daripada aliran
  @back              ─ kembali ke kad/input yang disekat sebelum ini
  @input <k>=<v>     ─ tetapkan atau ganti nilai medan input
  @click <action_id> ─ hantar kad dengan tindakan yang diberikan
  @help              ─ cetak teks bantuan ini
  @quit              ─ keluar daripada REPL
